import React from "react";

const ImageChangeOnMouseOver = () => {
    return (
    <div>
        <img primaryImg = "/static/images/rose.jpeg" 
             secondaryImg = "/static/images/colour flower.jpeg" alt="" />
        &nbsp; &nbsp; &nbsp; 
        <img primaryImg = "/static/images/track.jpeg"
             secondaryImg = "/static/images/download.jpeg" alt="" />
    </div>
    );
};

export default ImageChangeOnMouseOver;
